import React from 'react'

function Header() {
    return (
        <nav className="header">
            {/* logo on left */}
            <img
                className="header__logo"
                src="http://pngimg.com/uploads/amazon/amazon_PNG11.png">
            </img>
            {/* search box */}
            {/*  */}
        </nav>
    )
}

export default Header
